import { StyleHamburguer } from "./style";
import { AiFillAppstore, AiFillCarryOut, AiFillSetting } from "react-icons/ai";
import { BsFillPeopleFill } from "react-icons/bs";

const Hamburguer = () => {
  return (
    <StyleHamburguer>
      <div>
        <div></div>
        <span>Laudemir</span>
      </div>
      <div>
        <div>
          <AiFillAppstore />
          <p>Dashboard</p>
        </div>
        <div>
          <AiFillCarryOut />
          <p>Habits</p>
        </div>
        <div>
          <BsFillPeopleFill />
          <p>Groups</p>
        </div>
        <div>
          <p>Setttings</p>
        </div>
      </div>
      <div></div>
    </StyleHamburguer>
  );
};

export default Hamburguer;
